Tafura anoumba inogona kukamurwa muzvikamu zvakasiyana zvinoenderana nezvinhu zvavo, maumbirwo, mapatani, vashandisi uye mamiriro ekushandisa:
Zvinoenderana nezvakasiyana zvigadzirwa zvigadzirwa, inogona kuve yakakamurwa kuita PE tafura muforoma, PP tafura muforoma, ABS tafura muforoma, nezvimwe;
Zvinoenderana nemhando dzakasiyana dzechigadzirwa, inogona kukamurwa kuita Hmhango tafura muforoma, Kutenderera muforoma, Square muforoma, nezvimwe;
Zvinoenderana nemhando dzakasiyana dzechigadzirwa, inogona kukamurwa kuita Gkurasikirwa tafura muforoma, Rpatani patani tafura muforoma, Frosted tafura muforoma, nezvimwe;
Zvinoenderana nevashandisi vakasiyana, inogona kukamurwa kuita Children tafura anoumba, Adult tafura anoumba, nezvimwe;
Zvinoenderana nezviitiko zvakasiyana zvekushandisa, inogona kukamurwa kuita Dining tafura muforoma, Outdoor tafura muforoma, Garden tafura muforoma, Toy tafura muforoma, nezvimwe.
Heya Mould inotarisa mukugadzirwa uye kuvandudzwa kwetafura kuumbwa, uye inoteerera kusarudzwa nenzvimbo yetafura mould simbi, kutonhora sisitimu, yekuparadzanisa mutsetse, rusvingo ukobvu, kuvhenekera, nezvimwe.

Nyaya yemudzidzisi ndiyo yekutanga novel ye trilogy ye autobiographical yezvinyorwa yakaburitswa muna 1990, uye yakanyorwa nemunyori weSpanish uye mudzidzisi Josefina Aldecoa. Mabhuku anotevera ndiwo vakadzi vakapfeka zvitema (1994) uye Simba reDestiny (1997). Rugwaro rwokutanga rwaigona kurangarirwa semhinduro kuhurukuro yezvamatongerwe enyika yakabuda pashure poudzvanyiriri muSpain.
