daro, mavara ane moyo wakanaka achamubatsira kuenderera mberi. Zvakare, iwe unozogona kuita nzira iri nani yekurarama kune wese munhu.
Vanonyanya kutaurwa
Gabriela
Ndiyo protagonista de Nyaya yemudzidzisi; ndezve mukadzi anotapira uye anonzwisisa ane chinangwa chehupenyu kudzidzisa. Ane hunhu husingakotami pasi mukutarisana nenhamo, uye nechikonzero ichocho anoyemurwa nevanhu vane tsika vakamupoteredza. Nekudaro, iye zvakare anoshungurudzwa nevatambi vanogutsikana nemararamiro epakati.
